Sun July 18, 2010
I went to the park today to try to find a pavilion for rent but instead I happened to bump into Syvally who was sitting in front of the park all alone! I thought she was a park attendant at first on her break but she was just hanging out. So I decided to see if we could hang out together and maybe have a little fun in the process. After a little negotiation and a few hundred dollars we went into the bushes of the park and thats where all the action took place, she gave a great blowjob then went into a few fun positions and I gave her a nice facial to wrap things up. Im glad we didnt get caught! Enjoy!
